/**
 ** This file will be used for testing WebSQL database on diffrent browsers
 **/

var WebSQL = function () {

    var
        now = Date.now(),

        defaults = {
            initialSize:2 * 1024 * 1024,
            version:'' + now,
            databaseDesc:"Databse " + now,
            databaseName:"Databse" + now
        },

        db // the reference to the database
        ;

    function createTable() {

        // create the table we need
        db.transaction(function (tx) {
            tx.executeSql("CREATE TABLE WebSQLTest (id REAL UNIQUE, text TEXT, timestamp REAL, data blob)", [],
                function () {
                    Helper.debug('Table created ... ');
                    addRecords();
                }, function (t, e) {
                    Helper.error('Failed to create table.' + e.message);
                });
        });
    }

    // Add record to the table
    function addRecords() {
        var i, numberOfRecord = parseInt(Math.random() * 1000);
        db.transaction(function (tx) {
            for (i = 0; i < numberOfRecord; i++) {
                tx.executeSql("INSERT INTO WebSQLTest (id, text, timestamp, data) VALUES (?, ?, ?, ?)",
                    [
                        ++now,
                        'Image name ' + now,
                        now,
                        'data:image/png;base64,%3D'
                    ],
                    function () {
                    }
                    ,
                    function (t, e) {
                        Helper.error('Failed to add record to table. Error:' + e.message);
                    }
                )
            }
        });
        Helper.debug(numberOfRecord + ' Records added to table');
        countRecord();
    }

    /**
     * When executing select we use <b>readTransaction</b> instead of <b>transaction</b>
     */
    function countRecord() {
        Helper.debug('Counting number of records (Please wait, can take up to a minute.)');
        Helper.startWaiting();
        db.readTransaction(function (tx) {
            tx.executeSql("select count(id) as counter from WebSQLTest", [],
                function (t, result) {
                    Helper.debug('The table contains: ' + result.rows.item(0)["counter"] + ' Records');
                    Helper.stopWaiting();
                }, function (t, e) {
                    Helper.error('Failed counting number of items. Error:  ' + e.message);
                    Helper.stopWaiting();
                });
        });
    }


    function testDB() {

        Helper.debug('Opening /Creating WebSQL DB');

        // open / create db
        db = openDatabase(
            defaults.databaseName, // Database name
            defaults.version, //Version number
            defaults.databaseDesc, //Text description
            defaults.initialSize, // Estimated size of database
            function () {
                // callback will be called only on first use.
                Helper.debug('Success opening/creating DB...');
                createTable();
            }, function (t, e) {
                Helper.debug('Failed to open/create WebSQL DB.' + e);
            }
        );
    }

    return{

        init:function () {
            testDB();
        }
    }
}();

WebSQL.init();
